function plusOne(digits: number[]): number[] {
    let len: number = digits.length;
    for(let i = len - 1; i >= 0; i--){
        if(digits[i] == 9){
            digits[i] = 0;
        }else{
            digits[i]++;
            return digits;
        }
    }
    let ans: number[] = new Array(len + 1).fill(0);
    ans[0] = 1;
    return ans;
};
